import React from 'react';
import tradePic from '../assets/tradepic.jpg';
import javaP from '../assets/javaPic.jpg';
import ninja from '../assets/ninja.jpg';
import algotrade1 from '../assets/algotrade1.jpeg'

const tileData = [
       {
        img: tradePic,
        title: 'Algorithmic Trading',
        details: 'Live Trading in NYSE',
           reference:'../projects/algotrade'
       },
       {
        img: javaP,
        title: 'Bananas Potato Project',
        details: 'Bananas Indeed',
           reference:'../projects/bananas'
       },
        {
         img: ninja,
         title:'The Ninja Report',
         details:'sssshhhhhh',
            reference: '../projects/ninjareport'
        }
];

const algoTileData = [
    {
        img: algotrade1,
        title: 'First Use',
        author: 'author',
        cols: 2
    }
]

export default tileData;
